import React from 'react';

const Experience = () => (
  <div>
    <h2>Work Experience</h2>
    <p>Apr 2024 – Present OECD – Paris, France</p>
    <p>Position: Consultant</p>
    <p>Jan 2024 – Present Sciences Po – Paris, France</p>
    <p>Position: Co-instructor / Head TA</p>
    <p>Sep 2023 – Jun 2024 Position: Predoctoral Research Assistant</p>
  </div>
);

export default Experience;
